import React from 'react';

class App extends React.Component {

  state = {
    isloading: true,
    movie: []
  };

  componentDidMount() {
    console.log("Rendered successful")
  }
  render() {
    console.log("rendering");
    const { isloading } = this.state.isloading;
    return <div>
      {isloading ? "loading" : "we are ready"}
    </div>
  }
}

export default App;
